import React from "react";
import {add,sub,mult,div} from "./App";
function Para(){

return(<div>
<ul>
<li>sum of two no-  {add(9,8)}</li>
<li>sub of two no-  {sub(8,7)}</li>
<li>mult of two no-  {mult(6 ,8)}</li>
<li>div of two no-  {div(10,3)}</li>

</ul>
</div>
)

	}

export default Para;
